import React from "react";

function toggleTheme() {
  console.log("toggle theme");
}

function Nav() {
  return (
    <div class="navbar">
      <div class="nav-item">Portfolio</div>
      <a
        id="theme-dropdown"
        class="d-flex ml-auto nav-link text-icon-btn margin-left-collapse"
        onClick="toggleTheme()"
      >
        Theme
      </a>
    </div>
  );
}

export default Nav;
